import { useState } from "react";
import { ICreateActivityDto } from "../../types/global.typing";
import { FormControl, TextField, InputLabel, Select, MenuItem, Button } from "@mui/material";
import { useNavigate } from "react-router-dom";

const AddActivity = () => {
  const [activity, setActivity] = useState<ICreateActivityDto>({
    name: "",
    description: "",
    activityType: "",
    status: "",
    statusTheme: "",
    tag: "",
    tagTheme: "",
  });
  const redirect = useNavigate()

  const handleClickSaveBtn = () => {}
  const handleClickBackBtn = () => {
      redirect("/activities")
  }

  return (
    <div className="content">
      <div className="add-activity">
        <h2>Add New Activity</h2>
        <TextField
          autoComplete="off"
          label="Activity Name"
          variant="outlined"
          value={activity.name}
          onChange={(e) => setActivity({ ...activity, name: e.target.value })}
        />
        <TextField
          autoComplete="off"
          label="Activity Description"
          variant="outlined"
          value={activity.description}
          onChange={(e) => setActivity({ ...activity, description: e.target.value })}
        />
        <FormControl fullWidth>
               <InputLabel>Activity Type</InputLabel>
               <Select
                  value={activity.activityType}
                  label="Activity Type"
                  onChange={(e) => setActivity({ ...activity, activityType: e.target.value })}
               >
                  <MenuItem value="Hobby">Hobby</MenuItem>
                  <MenuItem value="School">School</MenuItem>
                  <MenuItem value="Job">Job</MenuItem>
                  <MenuItem value="Home">Home</MenuItem>
               </Select>
            </FormControl>
            <div className="btns">
              <Button variant="outlined" color="primary" onClick={handleClickSaveBtn}>
                Save
              </Button>
              <Button variant="outlined" color="secondary" onClick={handleClickBackBtn}>
                Save
              </Button>
            </div>
      </div>
    </div>
  );
};

export default AddActivity;
